/* Procedure structure for procedure `calculosaldos` */

/*!50003 DROP PROCEDURE IF EXISTS  `calculosaldos` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `calculosaldos`()
BEGIN
CREATE TEMPORARY TABLE calculosaldos
(
    cuenta DECIMAL (6,2),
    Natur VARCHAR(1),
    fechafin DATE,
    saldoi DECIMAL(15,6),
    debe  DECIMAL(15,6),
    haber DECIMAL(15,6),
    saldof DECIMAL(15,6)
);
	
SELECT t1.cuenta,t2.Natur,t1.fechafin,0,t1.debe,t1.haber,0 
FROM saldos AS t1 JOIN catctasat AS t2 ON t1.cuenta=t2.NumCta
WHERE t1.fechafin= (SELECT MAX(fechafin)FROM saldos)
ORDER BY cuenta;


UPDATE calculosaldos

SET debe = (SELECT debe
               FROM saldos INNER JOIN calculosaldos ON saldos.cuenta = calculosaldos.cuenta
               WHERE saldos.fechafin = MAX(fechafin)),
haber = (SELECT haber
               FROM saldos INNER JOIN calculosaldos ON saldos.cuenta = calculosaldos.cuenta
               WHERE saldos.fechafin = MAX(fechafin));



UPDATE calculosaldos
SET saldof = saldoi+debe-haber
WHERE Natur = 'D';

UPDATE calculosaldos
SET saldof = saldoi-debe+haber
WHERE Natur = 'A';

SELECT * FROM calculosaldos;
    END */$$
DELIMITER ;

